    console.log(loc.latitude);
    const lat = loc.latitude;
    console.log(loc.longitude);
    const long = loc.longitude;

    return fetch(`https://maps-proxy-dpewu.run-ap-south1.goorm.io/lat/${lat}/long/${long}`)
}
